import React from "react";
import Logout from "../Logout";
import Quiz from "../Quiz";

const Welcome = () => {
  return (
    <div className="quiz-bg">
      <div className="container">Welcome</div>
      <Logout />
      <Quiz />
    </div>
  );
};

export default Welcome;
